 12public class GraphTraverser: GraphTraversing {
 13    public var name: String { graph.name }
 14    public var hasPackages: Bool { !graph.packages.flatMap(\.value).isEmpty }
 15    public var path: Path.AbsolutePath { graph.path }
 16    public var workspace: Workspace { graph.workspace }
 17    public var projects: [Path.AbsolutePath: Project] { graph.projects }
 18
 19    /// It returns the targets of the graph projects.
 20    /// - Returns: A dictionary where the key is the path to the project, and the value are a dictionary where
 21    ///            the keys are the name of the targets, and the value the target representation.
 22    public func targets() -> [Path.AbsolutePath: [String: Target]] {
 23        return projects.mapValues { $0.targets }
 24    }
 25
 26    public var dependencies: [GraphDependency: Set<GraphDependency>] { graph.dependencies }
 27
 28    private let graph: Graph
 29    private let conditionCache = ConditionCache()
 30    private let conditionalTargets: Set<GraphDependency>
 31    private let swiftPluginExecutablesCache = GraphCache<GraphDependency, Set<String>>()
 32    private let systemFrameworkMetadataProvider: SystemFrameworkMetadataProviding =
 33        SystemFrameworkMetadataProvider()
 34    private let targetDirectTargetDependenciesCache: ThreadSafe<[GraphTarget: [GraphTarget]]> =
 35        ThreadSafe([:])
 36
 37    public required init(graph: Graph) {
 38        self.graph = graph
 39        conditionalTargets = Self.computeConditionalTargets(graph: graph)
 40    }
 41
 42    private static func computeConditionalTargets(graph: Graph) -> Set<GraphDependency> {
 43        if graph.dependencyConditions.isEmpty {
 44            return []
 45        }
 46        let directConditionalTargets = Set(graph.dependencyConditions.keys.map { [$0.from, $0.to] }.joined())
 47        var stack = Array(directConditionalTargets)
 48        var visited = Set<GraphDependency>()
 49        var references = Set<GraphDependency>()
 50        while let node = stack.popLast() {
 51            if visited.contains(node) {
 52                continue
 53            }
 54            visited.insert(node)
 55            if !directConditionalTargets.contains(node) {
 56                references.insert(node)
 57            }
 58            if let deps = graph.dependencies[node] {
 59                for dep in deps where !visited.contains(dep) {
 60                    stack.append(dep)
 61                }
 62            }
 63        }
 64        return references.union(directConditionalTargets)
 65    }
 66
 67    public var hasRemotePackages: Bool {
 68        graph.packages.values.flatMap(\.values).first(where: {
 69            switch $0 {
 70            case .remote: return true
 71            case .local: return false
 72            }
 73        }) != nil
 74    }
 75
 76    public func rootTargets() -> Set<GraphTarget> {
 77        Set(
 78            graph.workspace.projects.reduce(into: Set()) { result, path in
 79                result.formUnion(targets(at: path))
 80            }
 81        )
 82    }
 83
 84    public func allTargets() -> Set<GraphTarget> {
 85        allTargets(excludingExternalTargets: false)
 86    }
 87
 88    public func allTargetsTopologicalSorted() throws -> [GraphTarget] {
 89        try topologicalSort(
 90            Array(allTargets()),
 91            successors: {
 92                directTargetDependencies(path: $0.path, name: $0.target.name).map(\.graphTarget)
 93            }
 94        ).reversed()
 95    }
 96
 97    public func allInternalTargets() -> Set<GraphTarget> {
 98        allTargets(excludingExternalTargets: true)
 99    }
100
101    public func allTestPlans() -> Set<TestPlan> {
102        Set(schemes().flatMap { $0.testAction?.testPlans ?? [] })
103    }
104
105    public func rootProjects() -> Set<Project> {
106        Set(
107            graph.workspace.projects.compactMap {
108                projects[$0]
109            }
110        )
111    }
112
113    public func schemes() -> [Scheme] {
114        projects.values.flatMap(\.schemes) + graph.workspace.schemes
115    }
116
117    public func precompiledFrameworksPaths() -> Set<Path.AbsolutePath> {
118        let dependencies = graph.dependencies.reduce(into: Set<GraphDependency>()) { acc, next in
119            acc.formUnion([next.key])
120            acc.formUnion(next.value)
121        }
122        return Set(
123            dependencies.compactMap { dependency -> Path.AbsolutePath? in
124                guard case let GraphDependency.framework(path, _, _, _, _, _, _) = dependency else {
125                    return nil
126                }
127                return path
128            }
129        )
130    }
131
132    public func targets(product: Product) -> Set<GraphTarget> {
133        var filteredTargets: Set<GraphTarget> = Set()
134        for (path, projectTargets) in targets() {
135            for target in projectTargets.values {
136                guard target.product == product else { continue }
137                guard let project = projects[path] else { continue }
138                filteredTargets.formUnion([
139                    GraphTarget(path: path, target: target, project: project),
140                ])
141            }
142        }
143        return filteredTargets
144    }
145
146    public func target(path: Path.AbsolutePath, name: String) -> GraphTarget? {
147        guard let project = graph.projects[path],
148              let target = project.targets[name]
149        else { return nil }
150        return GraphTarget(path: path, target: target, project: project)
151    }
152
153    public func targets(at path: Path.AbsolutePath) -> Set<GraphTarget> {
154        guard let project = graph.projects[path] else { return Set() }
155        return Set(
156            project.targets.values.map { GraphTarget(path: path, target: $0, project: project) }
157        )
158    }
159
160    public func testPlan(name: String) -> TestPlan? {
161        allTestPlans().first { $0.name == name }
162    }
163
164    public func allTargetDependencies(path: Path.AbsolutePath, name: String) -> Set<GraphTarget> {
165        guard let target = target(path: path, name: name) else { return [] }
166        return allTargetDependencies(traversingFromTargets: [target])
167    }
168
169    public func allTargetDependencies(traversingFromTargets: [GraphTarget]) -> Set<GraphTarget> {
170        return transitiveClosure(traversingFromTargets) { target in
171            if let cachedTargetDependencies = targetDirectTargetDependenciesCache.value[target] {
172                return cachedTargetDependencies
173            } else {
174                let values = Array(
175                    directTargetDependencies(
176                        path: target.path,
177                        name: target.target.name
178                    )
179                )
180                .map(\.graphTarget)
181                targetDirectTargetDependenciesCache.mutate { cache in
182                    cache[target] = values
183                }
184                return values
185            }
186        }
187    }
188
189    public func directTargetDependencies(path: Path.AbsolutePath, name: String) -> Set<
190        GraphTargetReference
191    > {
192        let target = GraphDependency.target(name: name, path: path)
193        guard let dependencies = graph.dependencies[target]
194        else { return [] }
195        let targetDependencies =
196            dependencies
197                .compactMap(\.targetDependency)
198
199        return Set(convertToGraphTargetReferences(targetDependencies, for: target))
200    }
201
202    public func directLocalTargetDependencies(path: Path.AbsolutePath, name: String) -> Set<
203        GraphTargetReference
204    > {
205        let target = GraphDependency.target(name: name, path: path)
206        guard let dependencies = graph.dependencies[target],
207              graph.projects[path] != nil
208        else { return [] }
209
210        let localTargetDependencies =
211            dependencies
212                .compactMap(\.targetDependency)
213                .filter { $0.path == path }
214
215        return Set(convertToGraphTargetReferences(localTargetDependencies, for: target))
216    }
217
218    public func directNonExternalTargetDependencies(path: Path.AbsolutePath, name: String) -> Set<
219        GraphTargetReference
220    > {
221        directTargetDependencies(path: path, name: name)
222            .filter { reference in
223                switch reference.graphTarget.project.type {
224                case .local:
225                    return true
226                case .external:
227                    return false
228                }
229            }
230    }
231
232    /// Returns all direct target dependencies where the target is in another project.
233    private func directNonLocalTargetDependencies(path: Path.AbsolutePath, name: String) -> Set<GraphTargetReference> {
234        let dependencies = directTargetDependencies(path: path, name: name)
235        return dependencies.subtracting(directLocalTargetDependencies(path: path, name: name))
236    }
237
238    func convertToGraphTargetReferences(
239        _ dependencies: [(name: String, path: Path.AbsolutePath)],
240        for target: GraphDependency
241    ) -> [GraphTargetReference] {
242        dependencies.compactMap { dependencyName, dependencyPath -> GraphTargetReference? in
243            guard let projectDependencies = graph.projects[dependencyPath]?.targets,
244                  let dependencyTarget = projectDependencies[dependencyName],
245                  let dependencyProject = graph.projects[dependencyPath]
246            else {
247                return nil
248            }
249            let condition = graph.dependencyConditions[
250                (target, .target(name: dependencyTarget.name, path: dependencyPath))
251            ]
252            let graphTarget = GraphTarget(
253                path: dependencyPath, target: dependencyTarget, project: dependencyProject
254            )
255            return GraphTargetReference(target: graphTarget, condition: condition)
256        }
257    }
258
259    private func executableNonLocalDependencies(path: Path.AbsolutePath, targetName: String) -> Set<GraphDependencyReference> {
260        let dependencies = directNonLocalTargetDependencies(path: path, name: targetName)
261            .filter {
262                [.app, .appExtension].contains($0.target.product)
263            }
264            .map { GraphDependencyReference.product(target: $0.target.name, productName: $0.target.productNameWithExtension) }
265
266        return Set(dependencies)
267    }
268
269    public func resourceBundleDependencies(path: Path.AbsolutePath, name: String) -> Set<
270        GraphDependencyReference
271    > {
272        guard let target = graph.projects[path]?.targets[name] else { return [] }
273
274        func canHostResources(target: Target) -> Bool {
275            target.supportsResources && (target.product != .staticFramework || target.containsResources)
276        }
277
278        guard canHostResources(target: target) else { return [] }
279
280        func canHostResources(dependency: GraphDependency) -> Bool {
281            testTarget(dependency: dependency) { canHostResources(target: $0) }
282        }
283
284        let bundles = filterDependencies(
285            from: .target(name: name, path: path),
286            test: { dependency in
287                isDependencyResourceBundle(dependency: dependency) &&
288                    !(isDependencyExternal(dependency) || dependency.isPrecompiled) &&
289                    !(target.canEmbedPlugins() && canDependencyEmbedAsPlugin(dependency: dependency))
290            },
291            skip: canHostResources
292        )
293        // External bundles are copied only to targets that can embed products to follow SPM logic.
294        // This prevents scenarios when a bundle is copied to a dynamic framework and the SPM targets then can't find it.
295        // See this issue for more detalis: https://github.com/tuist/tuist/pull/6565
296        let externalBundles = filterDependencies(
297            from: .target(name: name, path: path),
298            test: { dependency in
299                guard isDependencyResourceBundle(dependency: dependency) else { return false }
300                // Precompiled bundles are embedded to any downstream target that supports resources to ensure Xcode previews work

135    fileprivate func mapDependencies(
136        topologicallySortedTargets: [GraphTarget],
137        replaceableTargets: Set<GraphTarget>,
138        precompiledArtifacts: [GraphTarget: AbsolutePath],
139        graphTraverser: GraphTraverser,
140        keepSourceTargets: Bool
141    ) async throws -> (dependencies: [GraphDependency: Set<GraphDependency>], conditions: [GraphEdge: PlatformCondition]) {
142        var visitedDependencies = [GraphDependency: GraphDependency]()
143        var graphDependencies = [GraphDependency: Set<GraphDependency>]()
144        var graphConditions = [GraphEdge: PlatformCondition]()
145
146        func traverse(_ graphTarget: GraphTarget) async throws -> GraphDependency {
147            let target = GraphDependency.target(name: graphTarget.target.name, path: graphTarget.project.path)
148
149            if let replacedTarget = visitedDependencies[target] { return replacedTarget }
150
151            let replacedTarget: GraphDependency
152            if replaceableTargets.contains(graphTarget) {
153                if graphTarget.target.product == .bundle, graphTarget.target.isMultiplatform {
154                    AlertController.current.warning(
155                        .alert(
156                            "Multi-platform bundles like \(graphTarget.target.name) are not fully supported by binary caching yet and therefore we don't recommend using them for release builds."
157                        )
158                    )
159                }
160                replacedTarget = try await artifactLoader.load(path: precompiledArtifacts[graphTarget]!)
161            } else {
162                replacedTarget = target
163            }
164
165            visitedDependencies[target] = replacedTarget
166
167            var targetDependencies = Set<GraphDependency>()
168
169            for dependency in graphTraverser.dependencies[target, default: Set()] {
170                let combinedCondition = graphTraverser.combinedCondition(to: dependency, from: target)
171                let replacedTargetDependency = if let target = graphTraverser.target(from: dependency) {
172                    try await traverse(target)
173                } else {
174                    dependency
175                }
176                switch dependency {
177                case .target(name: _, path: _, status: .none):
178                    continue
179                default:
180                    break
181                }
182                switch combinedCondition {
183                case let .condition(condition):
184                    graphConditions[GraphEdge(from: replacedTarget, to: replacedTargetDependency)] = condition
185                    targetDependencies.insert(replacedTargetDependency)
186                case .incompatible:
187                    break
188                }
189            }
190
191            graphDependencies[replacedTarget] = targetDependencies
192            if keepSourceTargets {
193                graphDependencies[target] = targetDependencies
194            }
195            return replacedTarget
196        }
197
198        for target in topologicallySortedTargets.reversed() {
199            _ = try await traverse(target)
200        }
201
202        return (graphDependencies, graphConditions)
203    }
204}

